// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
// marc veut avoir le full access. Ownable semble sufisant 
// import "@openzeppelin/contracts/token/ERC20/extensions/draft-ERC20Permit.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
// import "@openzeppelin/contracts/security/PullPayment.sol";  probably not compatible with Upgradeable

// Custom errors
error ExceedsWalletLimit();
error InvalidArrayLength();
error ExceedsArrayLimit();
error InsufficientAirdropTokens();
error ExceedsFeesLimit();
error IsPaused();
error BlacklistedAddress();
error AlreadyBlacklisted(address account, bool excluded);
error AlreadyExcludedFee(address account, bool excluded);
error AlreadyAPairAddress(address _pairAddress, bool isPairAddress);
// error ZeroAmount();
// error ZeroFee();
// error ZeroPercent();

/**
 * @title 
 * @author lopjf
 * @notice 
 * @dev 
 */

contract TokenNameTwo is
    ERC20,
    ERC20Burnable,
    Pausable,
    AccessControl,
    ReentrancyGuard
{

    // Custom events
    event ExcludeFee(address account, bool excluded);
    event Blacklisted(address account, bool blacklisted);
    event PairAddressCreated(address _pairAddress, bool isPairAddress);

    /* ========== STATE VARIABLES ========== */

    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    bytes32 public constant UPGRADER_ROLE = keccak256("UPGRADER_ROLE");

    address payable public ownerFeeRecipient;
    address payable public marketingFeeRecipient;
    address payable public devFeeRecipient;

    address public pairAddr;
    mapping(address => bool) public pairAddress;
    uint256 txCounter;

    uint256 public ownerFeePercent;
    uint256 public marketingFeePercent;
    uint256 public devFeePercent;
    uint256 public liquidityFeePercent;

    uint256 public totalDevAmount;
    uint256 public totalMarketingAmount;
    uint256 public totalOwnerAmount;
    uint256 public totalLiquidity;

    mapping(address => bool) private isExcludedFee;
    mapping(address => bool) private isBlacklisted;

    uint256 public airdropTokens;

    IUniswapV2Router02 private uniswapV2Router;

    /* ========== CONSTRUCTOR ========== */

    constructor(
        address router_
    ) ERC20("TokenNameTwo", "MTK") {
        _mint(msg.sender, 21000000 * 10 ** decimals());

        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(PAUSER_ROLE, msg.sender);


        // to change after deployment
        ownerFeeRecipient = payable(msg.sender);
        marketingFeeRecipient = payable(msg.sender);
        devFeeRecipient = payable(msg.sender);

        // set up uniswap factory and router
        uniswapV2Router = IUniswapV2Router02(router_); 

        // create a pair
        pairAddr = IUniswapV2Factory(uniswapV2Router.factory())
            .createPair(address(this), uniswapV2Router.WETH());
        pairAddress[pairAddr] = true;
        txCounter = 0;

        ownerFeePercent = 1;
        marketingFeePercent = 1;
        devFeePercent = 1;
        liquidityFeePercent = 1;

        totalDevAmount = 0;
        totalMarketingAmount = 0;
        totalOwnerAmount = 0;
        totalLiquidity = 0;

        isExcludedFee[msg.sender] = true;
        isExcludedFee[address(this)] = true;

        airdropTokens = 0;
    }


    function pause() public onlyRole(PAUSER_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(PAUSER_ROLE) {
        _unpause();
    }

    function _beforeTokenTransfer(address from, address to, uint256 amount)
        internal
        whenNotPaused
        override
    {
        super._beforeTokenTransfer(from, to, amount);
    }

    /* ========== VIEW FUNCTIONS ========== */

    function getIsExcludedFee(address account) external view returns (bool) {
        return isExcludedFee[account];
    }

    function getIsBlacklisted(address account) external view returns (bool) {
        return isBlacklisted[account];
    }

    /* ========== SETTER FUNCTIONS ========== */

    /**
     * @notice Set the addresses of the owner, liquidity pool, marketing and dev
     * @param _ownerFeeRecipient The address of the owner
     * @param _marketingFeeRecipient The address of the marketing
     * @param _devFeeRecipient The address of the dev
     */
    function bulkSetAddresses(
        address payable _ownerFeeRecipient,
        address payable _marketingFeeRecipient,
        address payable _devFeeRecipient
    ) public onlyRole(DEFAULT_ADMIN_ROLE) {
        ownerFeeRecipient = _ownerFeeRecipient;
        marketingFeeRecipient = _marketingFeeRecipient;
        devFeeRecipient = _devFeeRecipient;
    }

    /**
     * @notice Set the fees percentages
     * @param _ownerFeePercent The percentage of the buy/sell fee
     * @param _marketingFeePercent The percentage of the marketing fee
     * @param _devFeePercent The percentage of the dev fee
     * @param _liquidityFeePercent The percentage of the liquidity fee
     */
    function bulkSetFees(
        uint256 _ownerFeePercent,
        uint256 _marketingFeePercent,
        uint256 _devFeePercent,
        uint256 _liquidityFeePercent
    ) public onlyRole(DEFAULT_ADMIN_ROLE) {
        if (_ownerFeePercent + _marketingFeePercent + _devFeePercent + _liquidityFeePercent > 8)
            revert ExceedsFeesLimit();
        ownerFeePercent = _ownerFeePercent;
        marketingFeePercent = _marketingFeePercent;
        devFeePercent = _devFeePercent;
        liquidityFeePercent = _liquidityFeePercent;
    }

    /**
     * @notice Exclude or re-include an address from the fees
     * @param account: The address to exclude or re-include
     * @param excluded: True if the address should be excluded, false otherwise
     */
    function setIsExcludedFee(address account, bool excluded) external onlyRole(DEFAULT_ADMIN_ROLE) {
        if (isExcludedFee[account] == excluded)
            revert AlreadyExcludedFee(account, excluded);
        isExcludedFee[account] = excluded;
        emit ExcludeFee(account, excluded);
    }

    /**
     * @notice Add or remove an address from the blacklist
     * @param account: The address to blacklist or un-blacklist
     * @param excluded: True if the address should be blacklisted, false otherwise
     */
    function setIsBlacklisted(address account, bool excluded) external onlyRole(DEFAULT_ADMIN_ROLE) {
        if (isBlacklisted[account] == excluded)
            revert AlreadyBlacklisted(account, excluded);
        isBlacklisted[account] = excluded;
        emit Blacklisted(account, excluded);
    }

    function setPairAddress(address _pairAddress, bool isPairAddress) external onlyRole(DEFAULT_ADMIN_ROLE) {
        if (pairAddress[_pairAddress] == isPairAddress)
            revert AlreadyAPairAddress(_pairAddress, isPairAddress);
        pairAddress[_pairAddress] = isPairAddress;
        emit PairAddressCreated(_pairAddress, isPairAddress);
    }

    /* ========== AIRDROP FUNCTION ========== */

    /**
     * @notice Deposit tokens to be airdropped
     * @param amount: The amount of tokens to be deposited
     */
    function depositAirdropTokens(uint256 amount) public onlyRole(DEFAULT_ADMIN_ROLE) {
        super._transfer(_msgSender(), address(this), amount);
        airdropTokens += amount;
    }

    /**
     * @notice Airdrop tokens to multiple addresses
     * @param _recipients: The addresses of the recipients
     * @param _values: The amounts of tokens to be airdropped
     */
    function bulkAirdrop(address[] memory _recipients, uint256[] memory _values) public onlyRole(DEFAULT_ADMIN_ROLE) {
        uint256 totalValues = 0;

        if (_recipients.length != _values.length)
            revert InvalidArrayLength();
        if (_recipients.length > 100)
            revert ExceedsArrayLimit();
        for (uint256 i = 0; i < _values.length; i++) {
            totalValues += _values[i];
        }
        if (totalValues > airdropTokens)
            revert InsufficientAirdropTokens();
        for (uint256 i = 0; i < _recipients.length; i++) {
            airdropTokens -= _values[i];
            super._transfer(_msgSender(), _recipients[i], _values[i]);
        }
    }

    /**
     * @notice Airdrop tokens to multiple addresses
     * @param recipient: The addresses of the recipients
     * The problem if anyone can freely claim airdrops. someone could mint all the available tokens using several accounts
     * Even if we keep track of who claimed. It doesn't prevent someone from using several accounts to claim airdrops
     */
    function airdrop(address recipient, uint256 amount) public {
        super._transfer(_msgSender(), recipient, amount);
    }

    /* ========== FEES MECHANISM ========== */

    // Fees mechanisms with different addresses: Always get fees in ETH, BNB     // look into existing smart contract to fork
    // Transaction and wallet limits (exception for owner founder)
    function _transfer (address sender, address recipient, uint256 amount) internal virtual override {
        // if sender or recipient is blacklisted, revert
        if (isBlacklisted[sender] || isBlacklisted[recipient])
            revert BlacklistedAddress();

        // skip fees and limits for excluded addresses
        if (isExcludedFee[sender] || isExcludedFee[recipient]) {
            super._transfer(sender, recipient, amount);
            return;
        }
        // Limit the amount of token that can be owned by single owner by 1% of the total supply
        if (balanceOf(recipient) + amount > totalSupply() / 100)
            revert ExceedsWalletLimit();

        uint256 transferAmount = amount;

        // quid of a listing on another DEX. would not take the fees? // need to add to the pairAddress mapping
        if (pairAddress[sender] == true || pairAddress[recipient] == true) {      // buy or sell
            txCounter++;

            // Store cumulative fees
            uint256 devFeeAmount = (amount / 100) * devFeePercent;
            uint256 marketingFeeAmount = (amount / 100) * marketingFeePercent;
            uint256 ownerFeeAmount = (amount / 100) * ownerFeePercent;
            transferAmount = transferAmount - devFeeAmount - marketingFeeAmount - ownerFeeAmount;

            totalDevAmount += devFeeAmount;
            totalMarketingAmount += marketingFeeAmount;
            totalOwnerAmount += ownerFeeAmount;

            if (pairAddress[recipient] == true) { // sell
                // get liquidity fee and store the cumulative amount
                uint256 liquidityFeeAmount = (amount / 100) * liquidityFeePercent;
                transferAmount -= liquidityFeeAmount;

                totalLiquidity += liquidityFeeAmount;
            }

            if (txCounter >= 5) {
                // reset count
                txCounter = 0;

                // swap tokens for ETH
                swapTokensForETH(totalDevAmount + totalMarketingAmount + totalOwnerAmount + totalLiquidity);

                // send fees in ETH to the fee recipients
                uint256 ethBalance = address(this).balance;
                uint256 devFeeETHAmount = (ethBalance / 100) * devFeePercent;
                uint256 marketingFeeETHAmount = (ethBalance / 100) * marketingFeePercent;
                uint256 ownerFeeETHAmount = (ethBalance / 100) * ownerFeePercent;

                // send ETH to the fee recipients
                payable(devFeeRecipient).transfer(devFeeETHAmount);
                payable(marketingFeeRecipient).transfer(marketingFeeETHAmount);
                payable(ownerFeeRecipient).transfer(ownerFeeETHAmount);

                if (totalLiquidity > 0) {
                    // fetch remaining ETH
                    uint256 liquidityETHAmount = address(this).balance;
                    // add liquidity
                    addLiquidity(liquidityETHAmount, totalLiquidity);
                    // reset totalLiquidity
                    totalLiquidity = 0;
                }

                // reset total fees
                totalDevAmount = 0;
                totalMarketingAmount = 0;
                totalOwnerAmount = 0;
            }
            else {
                // sent fees and taxes to the contract for later use
                super._transfer(sender, address(this), amount - transferAmount);
            }
        }

        // send the rest of the tokens to the recipient
        super._transfer(sender, recipient, transferAmount);
    }

    // Swapping tokens for ETH using Uniswap 
    function swapTokensForETH(uint256 tokenAmount) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();
        _approve(address(this), address(uniswapV2Router), tokenAmount);
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, 
            path,
            address(this),
            block.timestamp
        );
    }

    function addLiquidity(uint256 tokenAmount, uint256 ethAmount) private {
        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // add the liquidity
        uniswapV2Router.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            address(0), // send LP token to burn address
            block.timestamp
        );
    }

